import React from "react";

import { Routes, Route } from "react-router-dom";
import { createTheme, ThemeProvider } from "@mui/material";
import pages from "../Pages/index";
import { red } from "@mui/material/colors";

const routes = [
  {
    path: "/",
    page: pages.intro(),
  },
];

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Routes>
          <Route path="/" exact element={pages.intro()} />
          <Route path="/contact" exact element={pages.contact()} />
          <Route
            path="/financial_information"
            exact
            element={pages.financial()}
          />
          <Route
            path="/business_information"
            exact
            element={pages.business()}
          />
          <Route path="/policies" exact element={pages.policies()} />
          <Route path="*" element={pages.intro()} />
        </Routes>
      </div>
    </ThemeProvider>
  );
}
const theme = createTheme({});

